import React, { useEffect, useState } from "react";
import {Line} from 'react-chartjs-2'

const getData = () => {
    return(
        fetch("https://covid-api.mmediagroup.fr/v1/cases?country=Australia").then(res => res.json())
        .then((result) => {
            console.log(result);
        })
    )
}


const CovidChart = () => {
    getData;
    const [data, setData] = useState([]);
    return (
      <div>
        <Line
          data={{
            labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul"],
            datasets: [
              {
                label: "Months",
                data: [65, 59, 80, 81, 56, 55, 40],
                fill: false,
                borderColor: "rgb(75,192,192)",
                tension: 0.1,
              },
            ],
          }}
        />
      </div>
    );
}

export default CovidChart;
